INSERT INTO `history` (`id`,`user_id`,`dt`,`key_id`,`action`,`lang_id`,`oldValue`,`newValue`) VALUES ('57','1','2012-03-04 22:28:11','42','changed','1','-','Leider konnte nicht automatisch ermittelt werden mit welchem Zeichensatz diese Backupdatei seinerzeit angelegt wurde. <br /><br />Sie müssen die Kodierung, in der Zeichenketten in dieser Datei vorliegen, manuell angeben.<br /><br />Danach stellt MySQLDumper die Verbindungskennung zum MySQL-Server auf den ausgewählten Zeichensatz und beginnt mit der Wiederherstellung der Daten.<br /><br />Sollten Sie nach der Wiederherstellung Probleme mit Sonderzeichen entdecken, so können Sie versuchen, das Backup mit einer anderen Zeichensatzauswahl wiederherzustellen.<br /><br />Viel Glück. ;)<br /><br /><br />');
